description:
The new Firmware (SW0650) for AUDI RNS-E AUDI DVD based navigation system.



New features in SW 0650 are:

1) altimeter (like MMI)
2) no 400 files limit on SD cards
3) more sound settings (bass, highs, middle)
4) navi announcement from both speaker (left/right)
5) title scrolling in the DIS


(You could use map DVDs from 2005, 2006, 2007 and 2008)






The SW0660 is NOT official SW? It's 0650 that have the SDS (Voice Command). I also put the VIM (Video in Motion) Hack in the map together whit the old firmware that is used for VIM Hacking.




To do the official update (SW0650) just unzip the file &quot;RNS-E_SW0650_STD.zip&quot; and burn it to ROOT folder of a CD, dont forget to finalize the cd. Do not burn it in Vista it wont work.



